import React, { useState } from 'react';
import Userdashbord from '../dashbord/Userdashbord'
import Packages from '../dashbord/Packages';
import Profile from '../dashbord/Profile';
import Fitness from '../dashbord/MyFitness'
import QrCodeinfo from '../dashbord/QRCode'

import { FaUser, FaDumbbell, FaQrcode, FaShoppingCart, FaUserCircle, FaThList } from 'react-icons/fa';

function UserPanel() {
    const [currentPage, setCurrentPage] = useState('user');

    const handlePageChange = (page) => {
        setCurrentPage(page);
    };

    return (
        <div className='flex bg-gray-900'>
            {/* slide bar */}
            <div className='w-1/6 h-screen p-4 bg-gray-800'>
                <h2 className='mb-4 flex items-center font-bold text-lg text-white'>
                    <FaThList className='mr-2' />
                    Dashboard
                </h2>
                <ul>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'user' ? 'bg-gradient-to-r from-fuchsia-600 to-purple-600 hover:bg-gradient-to-r from-violet-500 to-purple-500' : ''}`}
                        onClick={() => handlePageChange('user')}
                    >
                        <FaUser className='mr-2' />
                        Home
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'Fitness' ? 'bg-gradient-to-r from-fuchsia-600 to-purple-600 hover:bg-gradient-to-r from-violet-500 to-purple-500' : ''}`}
                        onClick={() => handlePageChange('Fitness')}
                    >
                        <FaDumbbell className='mr-2' />
                        Fitness Info
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'QrCodeinfo' ? 'bg-gradient-to-r from-fuchsia-600 to-purple-600 hover:bg-gradient-to-r from-violet-500 to-purple-500' : ''}`}
                        onClick={() => handlePageChange('QrCodeinfo')}
                    >
                        <FaQrcode className='mr-2' />
                        QR Code Info
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'packages' ? 'bg-gradient-to-r from-fuchsia-600 to-purple-600 hover:bg-gradient-to-r from-violet-500 to-purple-500' : ''}`}
                        onClick={() => handlePageChange('packages')}
                    >
                        <FaShoppingCart className='mr-2' />
                        Packages
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'profile' ? 'bg-gradient-to-r from-fuchsia-600 to-purple-600 hover:bg-gradient-to-r from-violet-500 to-purple-500' : ''}`}
                        onClick={() => handlePageChange('profile')}
                    >
                        <FaUserCircle className='mr-2' />
                        Profile
                    </li>
                </ul>
            </div>
            <div className='flex-1 p-1'>
                {currentPage === 'user' && <Userdashbord />}
                {currentPage === 'Fitness' && <Fitness />}
                {currentPage === 'QrCodeinfo' && <QrCodeinfo />}
                {currentPage === 'packages' && <Packages />}
                {currentPage === 'profile' && <Profile />}
            </div>
        </div>
    );
}

export default UserPanel;
